#include "legitbot.hpp"

void LegitBacktrack::Do(CUserCmd* cmd)
{
	if (!g_LocalPlayer)
		return; 

	for (int i = 1; i <= 64; i++)
	{
		C_BasePlayer* Player = C_BasePlayer::GetPlayerByIndex(i);
		if (!Player ||
			Player->IsDormant() ||
			!Player->IsPlayer() ||
			!Player->IsAlive() ||
			!Player->IsEnemy())
		{
			if (BacktrackRecords[i].size() > 0)
				for (int Tick = 0; Tick < BacktrackRecords[i].size(); Tick++)
					BacktrackRecords[i].erase(BacktrackRecords[i].begin() + Tick);
			continue;
		}

		BacktrackRecords[i].insert(BacktrackRecords[i].begin(), Hooks::TickInfo(Player));
		for (auto Tick : BacktrackRecords[i])
			if (!Utils::IsTickValid(Tick.SimulationTime, float(Variables.LegitBacktrackDuration) / 1000.f))
				BacktrackRecords[i].pop_back();
	}

	if (!g_LocalPlayer->IsAlive())
		return;

	int BacktrackedPlayer = -1;
	float MaxPlayerFov = FLT_MAX;

	for (int i = 1; i <= 64; i++)
	{
		C_BasePlayer* Player = C_BasePlayer::GetPlayerByIndex(i);
		if (!Player ||
			Player->IsDormant() ||
			!Player->IsPlayer() ||
			!Player->IsAlive() ||
			!Player->IsEnemy())
			continue;

		Vector ViewAngles;
		Math::AngleVectors(cmd->viewangles + (g_LocalPlayer->m_aimPunchAngle() * g_CVar->FindVar("weapon_recoil_scale")->GetFloat()), ViewAngles);
		float FovDistance = Math::DistancePointToLine(BacktrackRecords[i].front().HeadPosition, g_LocalPlayer->GetEyePos(), ViewAngles);

		if (MaxPlayerFov > FovDistance)
		{
			MaxPlayerFov = FovDistance;
			BacktrackedPlayer = i;
		}
	}
	ClosestTick = -1;
	float MaxTickFov = FLT_MAX;
	if (BacktrackedPlayer != -1)
	{
		for (int t = 0; t < BacktrackRecords[BacktrackedPlayer].size(); t++)
		{
			Vector ViewAngles2;
			Math::AngleVectors(cmd->viewangles + (g_LocalPlayer->m_aimPunchAngle() * g_CVar->FindVar("weapon_recoil_scale")->GetFloat()), ViewAngles2);
			float FovDistance2 = Math::DistancePointToLine(BacktrackRecords[BacktrackedPlayer].at(t).HeadPosition, g_LocalPlayer->GetEyePos(), ViewAngles2);

			if (MaxTickFov > FovDistance2)
			{
				MaxTickFov = FovDistance2;
				ClosestTick = t;
			}
		}
		if (ClosestTick != -1 && BacktrackRecords[BacktrackedPlayer].at(ClosestTick).SimulationTime != -1 && (cmd->buttons & IN_ATTACK))
			cmd->tick_count = TIME_TO_TICKS(BacktrackRecords[BacktrackedPlayer].at(ClosestTick).SimulationTime + Utils::GetLerpTime());
		
	}
}
void LegitAimbot::Do(CUserCmd* cmd, C_BaseCombatWeapon* Weapon)
{
	if (!g_LocalPlayer ||
		!g_LocalPlayer->IsAlive() ||
		!Weapon ||
		Weapon->IsKnife() ||
		Weapon->IsGrenade() ||
		!Variables.LegitAimbotEnabled ||
		!Variables.LegitAimbotFov ||
		!(cmd->buttons & IN_ATTACK))
		return;

	float MaxPlayerFov = Variables.LegitAimbotFov;
	int ClosestPlayerIndex = -1;
	QAngle AimAngle = QAngle{};
	QAngle ViewAngle = QAngle{};
	g_EngineClient->GetViewAngles(ViewAngle);
	Vector EyePos = g_LocalPlayer->GetEyePos();

	for (int i = 1; i <= 64; i++)
	{
		C_BasePlayer* Player = C_BasePlayer::GetPlayerByIndex(i);
		if (!Player ||
			!Player->IsPlayer() ||
			Player->IsDormant() ||
			!Player->IsAlive() ||
			!Player->IsEnemy())
			continue;

		matrix3x4_t BoneMatrix[128];
		if (!Player->SetupBones(BoneMatrix, 128, BONE_USED_BY_ANYTHING, g_GlobalVars->curtime))
			continue;

		Vector Hitbox;
		bool Backtrack = false;
		if (Variables.LegitBacktrackEnabled && LegitBacktrack::Get().ClosestTick != -1 && LegitBacktrack::Get().ClosestTick < LegitBacktrack::Get().BacktrackRecords[i].size() && LegitBacktrack::Get().BacktrackRecords[i].at(LegitBacktrack::Get().ClosestTick).MatrixBuilt)
		{
			Hitbox = Player->GetHitboxPos(
				(Variables.LegitAimbotHitbox == 3) ? 
				GetClosestHitbox(Player, LegitBacktrack::Get().BacktrackRecords[i].at(LegitBacktrack::Get().ClosestTick).BoneMatrix, EyePos)
				: GetHitboxFromInt(Variables.LegitAimbotHitbox), LegitBacktrack::Get().BacktrackRecords[i].at(LegitBacktrack::Get().ClosestTick).BoneMatrix);
			
			Backtrack = true;
		}
		if (!Backtrack)
			Hitbox = Player->GetHitboxPos((Variables.LegitAimbotHitbox == 3) ?
			GetClosestHitbox(Player, BoneMatrix, EyePos)
			: GetHitboxFromInt(Variables.LegitAimbotHitbox), BoneMatrix);

		float FovDistance = Math::GetFOV(ViewAngle + (g_LocalPlayer->m_aimPunchAngle() * g_CVar->FindVar("weapon_recoil_scale")->GetFloat()), Math::CalcAngle(g_LocalPlayer->GetEyePos(), Hitbox));

		if (MaxPlayerFov > FovDistance)
		{
			if (g_LocalPlayer->CanSeePlayer(Player, Hitbox))
			{
				MaxPlayerFov = FovDistance;
				ClosestPlayerIndex = i;
			}
		}
	}
	if (ClosestPlayerIndex != -1)
	{
		C_BasePlayer* ClosestPlayer = C_BasePlayer::GetPlayerByIndex(ClosestPlayerIndex);
		if (!ClosestPlayer) return; 
		matrix3x4_t BoneMatrix[128];
		if (!ClosestPlayer->SetupBones(BoneMatrix, 128, BONE_USED_BY_ANYTHING, g_GlobalVars->curtime))
			return;
		Vector Hitbox;
		bool Backtrack = false;
		if (Variables.LegitBacktrackEnabled && LegitBacktrack::Get().ClosestTick != -1 && LegitBacktrack::Get().ClosestTick < LegitBacktrack::Get().BacktrackRecords[ClosestPlayerIndex].size() && LegitBacktrack::Get().BacktrackRecords[ClosestPlayerIndex].at(LegitBacktrack::Get().ClosestTick).MatrixBuilt)
		{
			Hitbox = ClosestPlayer->GetHitboxPos(
				(Variables.LegitAimbotHitbox == 3) ?
				GetClosestHitbox(ClosestPlayer, LegitBacktrack::Get().BacktrackRecords[ClosestPlayerIndex].at(LegitBacktrack::Get().ClosestTick).BoneMatrix, EyePos)
				: GetHitboxFromInt(Variables.LegitAimbotHitbox), LegitBacktrack::Get().BacktrackRecords[ClosestPlayerIndex].at(LegitBacktrack::Get().ClosestTick).BoneMatrix);

			Backtrack = true;
		}
		if (!Backtrack)
			Hitbox = ClosestPlayer->GetHitboxPos((Variables.LegitAimbotHitbox == 3) ?
				GetClosestHitbox(ClosestPlayer, BoneMatrix, EyePos)
				: GetHitboxFromInt(Variables.LegitAimbotHitbox), BoneMatrix);
		AimAngle = Math::CalcAngle(g_LocalPlayer->GetEyePos(), Hitbox);
		AimAngle -= (g_LocalPlayer->m_aimPunchAngle() * g_CVar->FindVar("weapon_recoil_scale")->GetFloat()) * (float(Variables.LegitAimbotRcs) / 100.f);
		Math::SanitizeAngle(ViewAngle);
		QAngle DeltaAngle = ViewAngle - AimAngle;
		Math::SanitizeAngle(DeltaAngle);
		float Smoothing = (Variables.LegitAimbotType == 1 && Variables.LegitAimbotSmooth > 1) ? Variables.LegitAimbotSmooth : 1;
		QAngle FinalAngle = ViewAngle - DeltaAngle / Smoothing;
		if (Backtrack)
		{
			cmd->tick_count = TIME_TO_TICKS(LegitBacktrack::Get().BacktrackRecords[ClosestPlayerIndex].at(LegitBacktrack::Get().ClosestTick).SimulationTime + Utils::GetLerpTime());
		}
		if (!Math::SanitizeAngle(FinalAngle))
			return;
		cmd->viewangles = FinalAngle;
		if (Variables.LegitAimbotType != 2)
			g_EngineClient->SetViewAngles(cmd->viewangles);
	}
}
bool LBYBreaker() {

	auto speed = g_LocalPlayer->m_vecVelocity().Length2D();
	static float next_lby = 0.00f;
	float curtime = g_GlobalVars->curtime;

	if (!(g_LocalPlayer->m_fFlags() & FL_ONGROUND))
		return false;

	if (speed > 0.1f)
		next_lby = curtime + 0.22f;

	if (next_lby < curtime)
	{
		next_lby = curtime + 1.1f;
		return true;
	}
	else
		return false;
}
void LegitAimbot::DoLegitAntiaim(CUserCmd* cmd, C_BaseCombatWeapon* Weapon, bool& bSendPacket)
{
	if (!g_LocalPlayer ||
		!g_LocalPlayer->IsAlive() ||
		!Weapon ||
		Weapon->IsKnife() && cmd->buttons & IN_ATTACK ||
		!Weapon->IsGrenade() && cmd->buttons & IN_ATTACK && Weapon->CanFire() ||
		cmd->buttons & IN_USE ||
		Weapon->IsGrenade() && Weapon->m_fThrowTime() > 0.f ||
		g_LocalPlayer->m_nMoveType() == MOVETYPE_LADDER ||
		g_LocalPlayer->m_nMoveType() == MOVETYPE_NOCLIP)
		return;

	static int side = 1;

	if (InputSys::Get().IsKeyDown(0x43))
		side = 1;
	if (InputSys::Get().IsKeyDown(0x58))
		side = -1;

	QAngle StartAngles;
	g_EngineClient->GetViewAngles(StartAngles);
	float FakeYaw = StartAngles.yaw;
	float RealYaw = FakeYaw - g_LocalPlayer->MaxDesyncDelta() * side;
	float LBYYaw = FakeYaw + g_LocalPlayer->MaxDesyncDelta() * side;
	cmd->viewangles.yaw = FakeYaw;

	if (LBYBreaker())
	{
		cmd->viewangles.yaw = LBYYaw;
		bSendPacket = false;
		return;
	}
	if (!bSendPacket)
		cmd->viewangles.yaw = RealYaw;
}
int LegitAimbot::GetClosestHitbox(C_BasePlayer* Player, matrix3x4_t* BoneMatrix, Vector EyePos)
{
	QAngle ViewAngle = QAngle{};
	g_EngineClient->GetViewAngles(ViewAngle);
	float MaxFov = Variables.LegitAimbotFov;
	int ClosestHitbox = 0;
	for (int i = 0; i <= 6; i++)
	{
		float FovDistance = Math::GetFOV(ViewAngle + (g_LocalPlayer->m_aimPunchAngle() * g_CVar->FindVar("weapon_recoil_scale")->GetFloat()), Math::CalcAngle(EyePos, Player->GetHitboxPos(i, BoneMatrix)));
		
		if (MaxFov > FovDistance)
		{
			MaxFov = FovDistance;
			ClosestHitbox = i;
		}
	}
	return ClosestHitbox;
}
int LegitAimbot::GetHitboxFromInt(int Hitbox)
{
	if (Hitbox != HITBOX_HEAD && Hitbox != HITBOX_NECK)
		return HITBOX_CHEST;
	
	return Hitbox;
}
